- lettre de l'employeur motivant votre recrutement et les tâches précises confiées ; 
- formulaires CERFA n°15186*03 en original avec SMIC à jour (en 2 exemplaires dûment remplis avec passport en cours de validité (téléchargeables sur le site internet www.immigration.gouv.fr) feuillets 1 à 4 ;
- extrait du kbis daté de moins de 1 mois et original ;
 - statuts de l'entreprise ;
- copie attestation de vigilance ou dernier relevé de situation comptable des cotisations et contribution sociale URSSAF ;
- copie du dernier bordereau de versement des cotisations à la caisse des congés payés du bâtiment ou des travaux publics lorsque ce versement est obligatoire ;
- copie des 2 dernières pages du registre unique du personnel ou copie des 3 dernières déclarations des mouvements de personnel, pour les établissements de + de 50 salariés ;
- Copie des relevés de compte bancaire (et/ou les bordereaux de remise de chèques)   ainsi que les avis d’imposition 
- copie de votre contrat de travail
- CV et copie de vos diplômes
- Copie de votre nouveau passeport en cours de validité

Pièces à joindre obligatoirement :
- tous les certificats de scolarité, tous les relevés de notes et tous les diplômes obtenus depuis votre entrée en France.

Pièces supplémentaires à joindre si vous êtes en formation en alternance :
- contrat d'apprentissage ou de professionnalisation pour lequel sera jointe l’autorisation provisoire de travail validée par la plate-forme de la main d'oeuvre étrangère ou un opérateur de compétence (OPCO);
- attestation du responsable du centre de formation.

Pièces supplémentaires à joindre si vous êtes en emploi :
- contrat de travail pour lequel sera joint le formulaire CERFA n° 15186*03 complété par l'employeur avec les documents demandés en annexe (Kbis, attestation de paiement des cotisations sociales, lettre de motivation du recrutement par l’employeur, diplômes et CV du salarié);
- les trois derniers bulletins de salaire;
- une attestation de maintien dans l'emploi délivrée par l'employeur;

Pièces obligatoires
- Extrait K bis de moins de 6 mois ou inscription au registre concerné ;
- Attestation sur l’honneur de régularité de la situation au regard des obligations fiscale et sociale ;
- Bilan et compte de résultat des deux derniers exercices comptables ;

Le cas échéant : 
- Attestation de déclaration des aides « de minimis » perçues lors des 3 dernières années.
